- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1CTHIS AMENDED REPORT IS SUBMITTED
    TO CORRECT YEAR TO DATE TOTALS ON THE DETAIL SUMMARY PAGE.  THE CHANGES ARE A
    RESULT OF AMENDED REPORTS FILED FOR FEBRUARY, MARCH, APRIL AND MAY MONTHLY REPORTS.
    --------------------   THE SECOND AMENDED REPORT IS IN RESPONSE TO THE FEDERAL
    ELECTION COMMISSION LETTER DATED ON JANUARY 6, 2010.  THE REPORT CORRECTS SCHEDULE
    H2 TO LIST THE FEDERAL % FOR THE DIRECT MAIL PROGRAM AT 85%.  THE AMOUNT ON SCHEDULE
    H4 FOR DIRECT MAIL REMAINS UNCHANGED.  ITEM 2 OF THE LETTER QUESIONED FEDERAL
    ELECTION ACTIVITY (FEA) ON AMOUNTS ON COMPENSATION TYPE EXPENDITURES.  ONLY THE
    CHAIRMAN - GARY JONES SPENDS MORE THAN 25% OF HIS TIME ON FEA IN NON-ELECTION
    YEARS.  HIS SALARY WAS REPORTED AS FEA EXPENDITURS.  THIS REPORT MOVES HIS SHARE
    OF FEDERAL PAYROLL TAX DEPOSITS FROM SHARED EXPENSED (H/4) TO FEA EXPENDITURES.
    \ EACH MODIFIED EXPENDITURE HAS A MEMO TEXT.  ONLY PAYROLL TAXES WERE INVOLVED.\n"
